import React from "react";

const TFI = () => {
  return (
    <div id="tfi" style={{ padding: "40px", backgroundColor: "#f9f9f9" }}>
      <h2>TFI</h2>
      <p>
        TFI (Teach for Ibrahimbagh) is a movement that aims to provide quality education
        to underprivileged children. NSS Vasavi actively collaborates with TFI to make a
        difference by organizing teaching drives, workshops, and mentorship programs.
      </p>
    </div>
  );
};

export default TFI;
